import React from 'react';
import { Container, Typography, Box, IconButton, Avatar, Menu, MenuItem } from '@mui/material';
import PokerCardIcon from '@mui/icons-material/Casino';
import CoinsIcon from '@mui/icons-material/LocalAtm';
import Logout from '@mui/icons-material/Logout';
import AccountCircleIcon from '@mui/icons-material/AccountCircle';

function Navbar({name}) {

    const [anchorEl, setAnchorEl] = React.useState(null);

  return (
    <Container style={{ background: "#FF2F00"}} maxWidth>
      <Box sx={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', padding: '1rem 0' }}>
        {/* Left section with poker card icon and brand name */}
        <Box sx={{ display: 'flex', alignItems: 'center' }}>
          <IconButton color="inherit">
            <PokerCardIcon />
            <Typography variant="h6">BanLuck888</Typography>
          </IconButton>

        </Box>

        {/* Right section with user information, coins, and sign out */}
        <Box sx={{ display: 'flex', alignItems: 'center' }}>
            <AccountCircleIcon />
            <Typography>Hi, {name}!</Typography>

          {/* Coins icon and count */}
          <Typography variant="body1" sx={{ marginLeft:'2rem' }}>0 </Typography>
            <CoinsIcon sx = {{ marginRight: '2rem'}}/>

          {/* Sign Out */}
          <IconButton color="inherit">
            <Logout />
            <Typography>Sign out?</Typography>
          </IconButton>
        </Box>
      </Box>
    </Container>
  );
}

export default Navbar;
